void HAL_SPI_TxRxCpltCallback(SPI_HandleTypeDef *hspi)
{
  if(hspi == &hspi3)
  {
    uint32_t *acceleration_X_ptr,*acceleration_Y_ptr;
    switch(Input.accDataNumber)
    {
      case 0x01:
        acceleration_X_ptr=FRONT_100_50_X_transformed;
        acceleration_Y_ptr=FRONT_100_50_Y_transformed;
        break;   
      case 0x02:
        acceleration_X_ptr=FRONT_ARCAP_X_transformed;
        acceleration_Y_ptr=FRONT_ARCAP_Y_transformed;
        break;
      case 0x03:
        acceleration_X_ptr=FRONT_R94_X_transformed;
        acceleration_Y_ptr=FRONT_R94_Y_transformed;
        break;
      case 0x04:    
        acceleration_X_ptr=FRONT_15kmh_40_X_transformed;
        acceleration_Y_ptr=FRONT_15kmh_40_Y_transformed;
        break;
      case 0x05:    
        acceleration_X_ptr=REAR36_X_transformed;
        acceleration_Y_ptr=REAR36_Y_transformed;
        break;
      case 0x06:    
        acceleration_X_ptr=Side_15kmh_100_X_transformed;
        acceleration_Y_ptr=Side_15kmh_100_Y_transformed;
        break;
      case 0x07:    
        acceleration_X_ptr=Side_25kmh_100_X_transformed;
        acceleration_Y_ptr=Side_25kmh_100_Y_transformed;
        break;
      case 0x08:    
        acceleration_X_ptr=Side_R95_X_transformed;
        acceleration_Y_ptr=Side_R95_Y_transformed;
	    break;
    }
    uint32_t acceleration_32;
    if(memcmp(SPI_RXbuf,Request0x0cmd,4)==0)
    { 
       acceleration_32=(*(acceleration_X_ptr+ctr0));//x
       timeX+=0.5;
       SPI_resp[0]=acceleration_32>>24;
       SPI_resp[1]=acceleration_32>>16;
       SPI_resp[2]=acceleration_32>>8;
       SPI_resp[3]=acceleration_32;
       ctr0+=1;
	   if(timeX>200||timeY>200.0){timeX=-100; timeY=-100; ctr0=0; ctr2=0;}
    }
    else if (memcmp(SPI_RXbuf,Request0x2cmd,4)==0)
    { 
       acceleration_32=(*(acceleration_Y_ptr+ctr2));//y
       timeY+=0.5;
       SPI_resp[0]=acceleration_32>>24;
       SPI_resp[1]=acceleration_32>>16;
       SPI_resp[2]=acceleration_32>>8;
       SPI_resp[3]=acceleration_32;    
       ctr2+=1;
       if(timeX>200||timeY>200.0){timeX=-100; timeY=-100; ctr2=0; ctr0=0;}		
    }
	__NOP();
  }
}
