    HAL_FDCAN_GetRxMessage(&hfdcan1, FDCAN_RX_FIFO1, &RxHeader, DIAG_RESPONSE);
    store_CANframeRX(0,DIAG_RESPONSE,RxHeader.DataLength>>16);
/*-------------------«‡ÔÓÒ Ì‡ Ò˜ËÚ˚‚‡ÌËÂ ÓÒÚ‡Î¸Ì˚ı DTC-----------------------------*/
    Put_index1=FDCAN_Get_FIFO_Put_index(FIFO1);
