static uint32_t buffer_average_value(uint32_t *buffer_to_evaluate, uint8_t size)
{
	static uint32_t sum;
	uint32_t average;
  for(uint8_t counter=0;counter<size;counter++)
	{
		sum+=buffer_to_evaluate[counter];
	}
	average=sum/size;
	sum=0;
	return average;	
}
